import "./App.css";
import Header from "./components/Header.js";
import Main from "./components/Main.js";
import Additional from "./components/Additional.js";
import Footer from "./components/Footer.js";

function App() {
  return (
    <div className="App container">
      <Header />
      <Main />
      <Additional />
      <Footer />
    </div>
  );
}

export default App;
